const fs = require('fs');
const faceapi = require('face-api.js');

// Load face-api.js models
const MODEL_URL = './node_modules/face-api.js/weights';
faceapi.nets.ssdMobilenetv1.loadFromDisk(MODEL_URL);
faceapi.nets.faceLandmark68Net.loadFromDisk(MODEL_URL);
faceapi.nets.faceRecognitionNet.loadFromDisk(MODEL_URL);

// Function to compare two biometric templates
function compareBiometricTemplates(template1, template2) {
    // Convert saved descriptors back to Float32Array
    const descriptor1 = new Float32Array(template1);
    const descriptor2 = new Float32Array(template2);

    // Calculate the Euclidean distance between the descriptors
    const distance = faceapi.euclideanDistance(descriptor1, descriptor2);

    // You can set a threshold for similarity based on your requirements
    // Lower threshold means stricter matching
    const similarityThreshold = 0.6;

    // Compare the distance with the threshold
    const isMatch = distance < similarityThreshold;

    // Return the result
    return { isMatch, distance };
}


// Example usage
const template1 = Buffer.from("")



const template2 = Buffer.from("");

const result = compareBiometricTemplates(template1, template2);

if (result.isMatch) {
    console.log('Biometric templates match with a distance of:', result.distance);
} else {
    console.log('Biometric templates do not match. Distance:', result.distance);
}
